  false,\n\t\"url\": null,\n\t\"notes\": \"Water levels and water quality parameters
  recorded on Crane Creek in 2010. LOCATION: Lat. 41u00b037'21.347\"N, long 83u00b012'40.758\"W,
  near Oak Harbor, OH. Ottawa County, OH on Ottawa National Wildlife Refuge DRAINAGE
  AREA: 36,096 acres. PERIOD OF RECORD: Datalogger installed June 2009. Regional Office
  data analysis starts 2009. GAGE SITE 2010: Sutron Monitor in communication with
  Esterline pressure transducer and YSI water quality probe (6920). Instruments are
  powered by a 1.2 ampere solar panel run to a deep cycle marine battery through a
  Sunsaver power regulator. Stage is collected at 15-minute intervals and water quality
  is collected at 30-minute intervals. COOPERATION: USGS Great Lakes Science Center
  and Ottawa NWR\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
